import React, { Component } from 'react'

class Social extends Component {
    render() {
        return (
            <div className="social">
                <a href="#" target="_blank" rel="noopender noreferrer"><i class="fab fa-github"></i></a>
                <a href="#" target="_blank" rel="noopender noreferrer"><i class="fab fa-instagram"></i></a>
                <a href="#" target="_blank" rel="noopender noreferrer"><i class="fab fa-linkin"></i></a>
            </div>
        );
    }
}

export default Social;
